    if(item.charAt(0) === '#'){
      p[1] += 1
    } else if(item.charAt(0) === '.') {
      p[2] += 1
    } else {
      p[3] += 1
    }
  }
  return p
}
function compare(sp1,sp2) {
  if(sp1[0] - sp2[0]){
