    let element = {
      type: 'element',
      children: [],
      attributes: []
    }
    element.tagName = token.tagName
    // 添加属性
    for(let item of token){
      if(item !== 'type' && item !== 'tagName'){
        element.attributes.push({
          name: item,
          value: token[item]
        })
      }
    }
    top.children.push(element)
    element.parent = top

    // 判断是否为自封闭标签 自封闭标签不入栈
    if(!token.isSelfCloseing) stack.push(element)
